import React from 'react';
import { TreeNode } from 'react-organizational-chart';

function Child({children}) {
    return (
        <>
            {children.map((child)=>{
                return <TreeNode label={<div>{child.value.name}</div>}/>
            })}
        </>
    );
}

export default Child;
